import Button from "./Button";

function App() {
  return (
    <div>
      <h1>Welcome Back!!!</h1>
      <Button text="현덕"></Button>
      <Button text="소라"></Button>
      <Button text="소영"></Button>
    </div>
  );
}

export default App;
